import React from 'react';
import logo from './logo.svg';
import './App.css';
import Databutton from './Databutton.js';

function App() {
    return (
        <div className="App">
            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
                <div className="form-control">
                    <Databutton></Databutton>
                </div>
            </header>
        </div>
    );
}

export default App;
